uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Parameters
uniform float u_speed;
uniform float u_portal_intensity;
uniform float u_spike_height;
uniform float u_mist_density;
uniform float u_inner_complexity;
uniform float u_camera_dist;
uniform float u_portal_wobble;
uniform float u_armillary_rings;
uniform float u_ring_thickness;

out vec4 fragColor;

#define MAX_STEPS 100
#define SURF_DIST 0.001
#define MAX_DIST 50.0

// --- Math Utilities ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// 3D Rotation helper
vec3 rotateAxis(vec3 p, float angle, vec3 axis) {
    axis = normalize(axis);
    float s = sin(angle);
    float c = cos(angle);
    float oc = 1.0 - c;
    mat3 m = mat3(
        oc * axis.x * axis.x + c,           oc * axis.x * axis.y - axis.z * s,  oc * axis.z * axis.x + axis.y * s,
        oc * axis.x * axis.y + axis.z * s,  oc * axis.y * axis.y + c,           oc * axis.y * axis.z - axis.x * s,
        oc * axis.z * axis.x - axis.y * s,  oc * axis.y * axis.z + axis.x * s,  oc * axis.z * axis.z + c
    );
    return m * p;
}

float hash(vec3 p) {
    p = fract(p * 0.3183099 + 0.1);
    p *= 17.0;
    return fract(p.x * p.y * p.z * (p.x + p.y + p.z));
}

float noise(vec3 x) {
    vec3 i = floor(x);
    vec3 f = fract(x);
    f = f * f * (3.0 - 2.0 * f);
    return mix(mix(mix(hash(i + vec3(0,0,0)), hash(i + vec3(1,0,0)), f.x),
                   mix(hash(i + vec3(0,1,0)), hash(i + vec3(1,1,0)), f.x), f.y),
               mix(mix(hash(i + vec3(0,0,1)), hash(i + vec3(1,0,1)), f.x),
                   mix(hash(i + vec3(0,1,1)), hash(i + vec3(1,1,1)), f.x), f.y), f.z);
}

// --- SDFs ---

float sdTorus(vec3 p, vec2 t) {
    vec2 q = vec2(length(p.xz) - t.x, p.y);
    return length(q) - t.y;
}

float sdBox(vec3 p, vec3 b) {
    vec3 q = abs(p) - b;
    return length(max(q, 0.0)) + min(max(q.x, max(q.y, q.z)), 0.0);
}

// Complex interior geometry
float interiorGeo(vec3 p) {
    float t = iTime * u_speed * 0.5;
    p.xy *= rot(p.z * 0.2 + t);
    vec3 q = mod(p, 2.0) - 1.0;
    float d = sdBox(q, vec3(0.2));
    float loops = floor(u_inner_complexity / 3.0);
    for(float i=0.0; i<3.0; i++) {
        p.xz *= rot(t * 0.3);
        p = abs(p) - 0.5;
        d = min(d, sdBox(p, vec3(0.1, 0.8, 0.1)));
    }
    return d;
}

// The ground waves and spikes
float groundSDF(vec3 p) {
    float t = iTime * u_speed;
    float h = sin(p.x * 0.5 + t) * cos(p.z * 0.5 - t * 0.8) * 0.5;

    // Spikes logic
    vec2 grid = fract(p.xz * 0.4) - 0.5;
    float spikes = (1.0 - length(grid)) * u_spike_height;
    spikes *= noise(p * 0.5 + t);

    return p.y + 2.0 - h - spikes;
}

// Scene Map with Armillary Sphere
float map(vec3 p) {
    float t = iTime * u_speed;

    // 1. Ground
    float d = groundSDF(p);

    // 2. Armillary Sphere Portal
    vec3 pPortal = p - vec3(0.0, 1.5, 0.0);
    float portalBase = 1e10;

    // Generate concentric rotating rings
    for(float i = 0.0; i < u_armillary_rings; i++) {
        vec3 pRing = pPortal;
        float phase = i / u_armillary_rings;

        // Each ring rotates differently
        pRing = rotateAxis(pRing, t * (1.0 + phase), normalize(vec3(sin(phase * 6.28), cos(phase * 6.28), 0.5)));
        pRing = rotateAxis(pRing, t * 0.5, vec3(0.0, 1.0, 0.0));

        float ring = sdTorus(pRing, vec2(2.5, u_ring_thickness));

        // Wobble the ring surface
        ring -= noise(pRing * 5.0 + t) * (u_portal_wobble * 0.1);

        portalBase = min(portalBase, ring);
    }

    // Center Core
    float core = length(pPortal) - 0.4;
    portalBase = min(portalBase, core);

    return min(d, portalBase);
}

vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

// --- Main Rendering ---

void main() {
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float t = iTime * u_speed;

    // Camera setup
    vec3 ro = vec3(0.0, 2.0, -u_camera_dist);
    ro.xz *= rot(iMouse.x * 0.01);
    vec3 ta = vec3(0.0, 1.0, 0.0);
    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f + uv.x * r + uv.y * u);

    float d = 0.0;
    float dist = 0.0;
    vec3 p;

    // Volumetric/Glow accumulators
    float portalGlow = 0.0;
    float innerBlue = 0.0;

    // Raymarching
    for(int i=0; i<MAX_STEPS; i++) {
        p = ro + rd * dist;
        d = map(p);

        // Portal Glow accumulation (Armillary field)
        vec3 center = vec3(0.0, 1.5, 0.0);
        float portalDist = length(p - center);

        // Sphere of energy around the rings
        float glowField = 0.05 / (0.1 + pow(abs(portalDist - 2.5), 1.5));
        portalGlow += glowField;

        // Interior Geometry accumulation (Blue)
        if(portalDist < 2.5) {
            float inner = interiorGeo(p * 1.5);
            innerBlue += smoothstep(0.1, 0.0, inner) * 0.15;
        }

        if(d < SURF_DIST || dist > MAX_DIST) break;
        dist += d * 0.75; // Slower steps for better glow integration
    }

    // Lighting and Shading
    vec3 col = vec3(0.0);

    if(dist < MAX_DIST) {
        vec3 n = getNormal(p);
        vec3 l = normalize(vec3(1, 4, -2));
        float dif = clamp(dot(n, l), 0.0, 1.0);
        float amb = 0.1;

        if(p.y < -0.5) { // Ground logic
            col = vec3(0.1, 0.12, 0.15) * dif + amb;
            col += vec3(0.0, 0.4, 0.6) * (1.0 - n.y) * 0.3; // Blue tint on slopes
        } else { // Armillary Ring material logic
            col = vec3(1.0, 0.6, 0.2) * dif * 2.5;
            col += vec3(1.0, 0.9, 0.5) * pow(clamp(1.0 + dot(rd, n), 0.0, 1.0), 4.0); // Rim light
        }
    }

    // Add Portal Orange Glow
    vec3 orange = vec3(1.0, 0.4, 0.1) * portalGlow * u_portal_intensity * 0.5;
    col += orange;

    // Add Inner Blue Geometry Glow
    vec3 blue = vec3(0.1, 0.5, 1.0) * innerBlue * 2.0;
    col += blue;

    // Misty Fog
    float fog = exp(-dist * u_mist_density * 0.2);
    vec3 fogCol = mix(vec3(0.02, 0.04, 0.08), vec3(0.3, 0.15, 0.05), portalGlow * 0.1);
    col = mix(fogCol, col, fog);

    // Particles (Embers)
    float particles = pow(noise(p * 3.0 + vec3(0, t, 0)), 12.0) * portalGlow;
    col += particles * vec3(1.0, 0.7, 0.3);

    // Post-processing
    col = pow(col, vec3(0.9)); // Slight gamma tweak
    col *= 1.1 - length(uv) * 0.4; // Vignette

    fragColor = vec4(col, 1.0);
}
